const disableControl = (controls) => {
    Object.values(pages).forEach(page => {
        Object.values(page.controls).forEach(control => {
            if(controls.includes(control.text)){
                controlToDisable = document.getElementById(control.id)
                controlToDisable.classList.add("gazetimator-control-disabled")
                control.state = 0
            }
        })
    })
}

const enableControl = (controls) => {
    Object.values(pages).forEach(page => {
        Object.values(page.controls).forEach(control => {
            if(controls.includes(control.text)){
                controlToEnable = document.getElementById(control.id)
                if(controlToEnable.classList.contains("gazetimator-control-disabled")){
                    controlToEnable.classList.remove("gazetimator-control-disabled")
                }
                control.state = 1
            }
        })
    })
}

const appendFloatingMenuButton = () => {
    let didMoveFloatingBtn = false
    const circle = document.createElement("div")
    circle.id = "gazetimator-draggable-menu-btn"
    circle.classList.add("gazetimator-draggable-menu-btn")

    circle.innerHTML = `
        <div class="gazetimator-draggable-menu-icon"></div>
    `

    document.body.appendChild(circle)

    circle.addEventListener('mousedown', function(e) {
        didMoveFloatingBtn = false
        let shiftX = e.clientX - circle.getBoundingClientRect().left;
        let shiftY = e.clientY - circle.getBoundingClientRect().top;

        function moveAt(clientX, clientY) {
            let newX = clientX - shiftX;
            let newY = clientY - shiftY;

            // Boundary checks
            let rightEdge = window.innerWidth - circle.offsetWidth;
            let bottomEdge = window.innerHeight - circle.offsetHeight;

            if (newX < 0) newX = 0;
            if (newY < 0) newY = 0;
            if (newX > rightEdge) newX = rightEdge;
            if (newY > bottomEdge) newY = bottomEdge;

            circle.style.left = newX + 'px';
            circle.style.top = newY + 'px';
        }

        function onMouseMove(event) {
            didMoveFloatingBtn = true
            moveAt(event.clientX, event.clientY);
        }

        document.addEventListener('mousemove', onMouseMove);

        circle.onmouseup = function() {
            document.removeEventListener('mousemove', onMouseMove);
            circle.onmouseup = null;
            if(!didMoveFloatingBtn){
                floatingMenuButtonClicked()
            }
        };

    });

    circle.ondragstart = function() {
        return false;
    };
}

